    return (
      <div className="flex flex-wrap justify-center neon">
        <p>▹ I have</p>
        <p className='grow dim'>
          <Typical
            steps={[
              "watched 200 anime",
              1500,
              "watching 15 anime",
              1500,
              "planning to watch 20 anime"
              ]}
            loop={Infinity}
            wrapper="b"
          />
        </p>
      </div>
    );
  }
}

export default Code;
